import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import AcUnitIcon from '@mui/icons-material/AcUnit';
import WbSunnyIcon from '@mui/icons-material/WbSunny';
import ThunderstormIcon from '@mui/icons-material/Thunderstorm';
import "./SearchBox.css";
import { useState } from 'react';

export default function SearchBox() {
    const [city, setCity] = useState("");
    const [weatherInfo, setWeatherInfo] = useState(null);
    const [error, setError] = useState(null);
    const API_URL = "https://api.openweathermap.org/data/2.5/weather";
    const API_KEY = "7286b2701b230d4fc960f9f0ac8bc9ac";

    const COLD_URL = "data:image/png;base64,";
    const RAINY_URL = "data:image/png;base64,";
    const HOT_URL = "data:image/png;base64,";

    let getWeatherInfo = async (city) => {
        try {
            let response = await fetch(`${API_URL}?q=${city}&appid=${API_KEY}&units=metric`);
            let jsonResponse = await response.json();
            if (jsonResponse.cod === 200) { // cod represents the status code
                let result = {
                    temp: jsonResponse.main.temp,
                    tempMin: jsonResponse.main.temp_min,
                    tempMax: jsonResponse.main.temp_max,
                    humidity: jsonResponse.main.humidity,
                    feelsLike: jsonResponse.main.feels_like,
                    weather: jsonResponse.weather[0].description,
                };
                setWeatherInfo(result);
                setError(null); // Clear any previous errors
            } else {
                console.error("Error fetching weather data: ", jsonResponse.message);
                setWeatherInfo(null);
                setError("No such place exists.");
            }
        } catch (error) {
            console.error("Error fetching weather data: ", error);
            setWeatherInfo(null);
            setError("An error occurred while fetching weather data.");
        }
    };

    const handleChange = (evt) => {
        setCity(evt.target.value);
    };

    const handleSubmit = (evt) => {
        evt.preventDefault();
        getWeatherInfo(city);
    };

    return (
        <div>
            <h3>Search</h3>
            <form onSubmit={handleSubmit}>
                <TextField
                    id="city" 
                    label="City Name" 
                    variant="outlined" 
                    required
                    value={city}
                    onChange={handleChange}
                />
                <br /><br />
                <Button variant="contained" type="submit">Search</Button>
                {error && <p style={{color: "red"}}>{error}</p>}
            </form>
            {weatherInfo && (
                <Card sx={{ maxWidth: 345, marginTop: 2 }}>
                    <CardMedia
                        component="img"
                        alt="weather"
                        height="140"
                        image={weatherInfo.humidity > 80 ? RAINY_URL : weatherInfo.temp > 30 ? HOT_URL : COLD_URL}
                    />
                    <CardContent>
                        <Typography gutterBottom variant="h5" component="div">
                            {city}{
                                weatherInfo.humidity > 80 ? <ThunderstormIcon/> : weatherInfo.temp > 30 ? <WbSunnyIcon/> : <AcUnitIcon/>
                            }
                        </Typography>
                        <Typography variant="body2" color="text.secondary">
                            <p>Temperature: {weatherInfo.temp}C</p>
                            <p>Min Temperature: {weatherInfo.tempMin}C</p>
                            <p>Max Temperature: {weatherInfo.tempMax}C</p>
                            <p>Humidity: {weatherInfo.humidity}%</p>
                            <p>Feels Like: {weatherInfo.feelsLike}C</p>
                            <p>Weather: {weatherInfo.weather}</p>
                        </Typography>
                    </CardContent>
                    <CardActions>
                        <Button size="small">Share</Button>
                        <Button size="small">Learn More</Button>
                    </CardActions>
                </Card>
            )}
        </div>
    );
}
